import React from 'react';
import { Link } from 'react-router-dom';
import './CardItem.css'

function CardItem(props) {
  return (
    <>
        <div className='card-item-container'>
            <h1 className='card-item-title'>{props.title}</h1>
            <p className='card-item-author'> By: {props.author == null || props.author == ''? 'Unknown' : props.author } </p>
            <p className='card-item-description'> {props.description} </p>
            <div className='card-item-buttons-container'>
                <a className='card-item-link-button' href={props.link}><img src='./images/url.png' alt='A URL icon'></img></a>
                <img className='card-item-plus-button' src='./images/plus_sign.png' alt='A URL icon'></img>
            </div>

        </div>
    </>
  )
}

export default CardItem;
